import React, { Component } from "react";
import Producto from "./Producto";

class App extends Component {
        render() {
            const productoDetalle = {
                productoNombre:"Galletitas Don Satur",
                productoDescripcion:"Don Satur Dulces",
                productoPrecio:"25.50",
                productoSKU:"7790586",
                productoCantidad:"2" 
            }
        return (
            <div>
                <Producto productoDetalle={this.productoDetalle}/>
            </div>
        )
    }
}

export default App;
